   set expected [read $id]
   close $id

-  if [! [string compare $output $expected]] {
+  if {! [string compare $output $expected]} {
     pass "$classname output"
     return 1
   } else {
-	fail "$classname output"
-	return 0
+    fail "$classname output"
+    return 0
   }
 }
